//SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

contract Eduvate {
    address payable public systemAddress;

    mapping(uint => mapping (uint => uint)) queryVotes;
    mapping(uint => QueryBountyReward) queryIdBountyMapping;

    struct QueryBountyReward{
        address userAddress;
        uint queryReward;
    } QueryBountyReward sample;

    constructor(){
        systemAddress =payable(address( msg.sender));
    }

    event queryTransaction(
        address userAddress,
        address systemAddress,
        uint queryId
    );

    event commentTransaction(
        address userAddress,
        address systemAddress,
        uint queryId,
        uint commentId
    );

    event studentPerformanceEvent(
        address studentAddress,
        Performance performance,
        uint courseValue,
        uint returnValue,
        bool isPossible,
        bool transferDone
    );

    modifier onlySystemModifier {
        require(msg.sender == systemAddress);
        _;
    }

    //    Add Equal to condition later as gas fees
    modifier minimumBalanceModifier {
        require(msg.sender.balance > msg.value);
        _;
    }

    enum Performance{NONE,BAD,GOOD,BEST} Performance studentPerformance;

    //Add modifier for only system
    //Once done can't be done again - To check how to do so later
    //Modifier for balance
    function studentCourseGrade(Performance stuPerformance, address studentAddress, uint courseValue) public payable onlySystemModifier returns (bool) {
        bool isPossible = false;
        bool transferDone = false;
        uint valueToReturn = ((uint(stuPerformance) - 1) * courseValue)/10;
        if(address(this).balance >= valueToReturn){
            isPossible = true;
            if(valueToReturn !=0){
                (bool success, ) = (studentAddress).call{value:valueToReturn}("");
                transferDone = success;
            }
            else
                transferDone = false;
        }
        emit studentPerformanceEvent(studentAddress, stuPerformance, courseValue, valueToReturn, isPossible, transferDone);
        return transferDone;
    }
    //To @return string or address somehow
    function getSystemAddress() public view returns(address){
        return systemAddress;
    }


    //    Modifier for balance
    //    Used for making bounty queries
    function registerQuery(uint queryId) public payable minimumBalanceModifier returns (bool){
        emit queryTransaction(msg.sender, address(this), msg.value);
        (bool success, ) = address(this).call{value:msg.value}("");
        QueryBountyReward memory currentQuery;
        currentQuery.userAddress = msg.sender;
        currentQuery.queryReward = msg.value;
        queryIdBountyMapping[queryId] = currentQuery;
        return success;
    }
    //    function queryRewardFunction(uint queryId, QueryBountyReward [] comments, uint size) public onlySystemModifier{
    //
    //    }

    function getBalance() public view returns (uint){
        return address(this).balance;
    }

    function updateVote(uint queryId, uint commentId) public{
        queryVotes[queryId][commentId] = queryVotes[queryId][commentId]+1;
    }

    function addComment(uint queryId, uint commentId) public{
        queryVotes[queryId][commentId] = 0;
    }

    function closeContract() public{
        selfdestruct(systemAddress);
    }

    function register() public payable returns(bool) {
        emit queryTransaction(msg.sender, systemAddress, 0);
        return true;
    }
}
